Trivia
In the scene where Dr. &quot;Bones&quot; McCoy and Carol Marcus are about to open one of the 72 missiles to prove Khan's claim that there's more then just a missile inside, Bones mentions that he once performed a emergency C-Section on a pregnant Gorn, noting &quot;those little bastards bite!&quot; This is reference to a off-screen event in the video game tie-in Star Trek: The Video Game where Sulu stuns a pregnant Gorn and Bones performs said C-Section.

Goofs
During the exchange negotiations between Khan and Spock, Khan says he will destroy the Enterprise's life support, located behind the aft nacelle. The nacelles are the two tube-like structures behind the saucer section, one to the right and the other to the left. There is no 'aft' nacelle. Also considering the nacelles protrude out behind the ship, there is nothing behind them.

